import React from "react";
import { Link } from 'react-router-dom';
import "./homepage.css";

function Homepage() {
    return (
        <div className="homepage">
            <Link to="/music" className="window c1" style={{ backgroundImage: `url('../public/musicPlayer/rain.jpg')` }}>
                <img src={'listen_music1.jpg'} alt="Rain" style={{ objectFit: 'contain', width: '100%', height: '100%', opacity: 0.9 }} />
                {/* <div>Music</div> */}
            </Link>
            <Link to="/page2" className="window c2" style={{ backgroundImage: `url('/music/rain.jpg')` }}>
                <img src={'play_music1.jpg'} alt="Rain" style={{ width: '100%', height: '100%', objectFit: 'cover', opacity: 0.9 }} />
                {/* <div>Page 2</div> */}
            </Link>
            <Link to="/" className="window c3" style={{ backgroundImage: `url('/rain.jpg')` }}>
                <img src={'admin1.jpg'} alt="Rain" style={{ width: '100%', height: '100%', objectFit: 'cover', opacity: 0.9 }} />
                {/* <div>Page 3</div> */}
            </Link>
        </div>
    );
}

export default Homepage;
